import './App.css';

function App() {
  return (
  <body>
    <nav class="navbar navbar-light bg-faded">
      <div class="container">
        <span class="navbar-brand">Screw</span>
        <ul class="nav navbar-nav pull-xs-right">
          <li class="nav-item">
            <a class="nav-link" href="https://github.com/dumbmatter/screw">
              <span class="hidden-xs-down">View on GitHub</span>
              <span class="octicon octicon-mark-github" aria-hidden="true"></span>
            </a>
          </li>
        </ul>
      </div>
    </nav>

    <div id="app"></div>

    <script src="app.js"></script>
  </body>
  );
}

export default App;
